import { Box, Typography } from "@mui/material";
import React from "react";

function PlayStore() {
  return (
    <Box
      sx={{
        display: "grid",
        maxWidth: "100%",
        margin: "0 auto",
        padding: 0,
        height: "550px",
        backgroundColor: "#e3f2fd",
        marginTop: "50px",
      }}
    >
      <Typography
        sx={{
          fontFamily: "Manrope, sans-serif !important",
          padding: 5,
          marginLeft: "410px",
          fontSize: "2.3rem",
          fontWeight: "700",
          color: "black",
          lineHeight: 1.2,
          position: "relative",
          display: "inline-block",
          "&::after": {
            content: '""',
            position: "absolute",
            right: 40,
            borderRadius: "5px",
            bottom: "35px",
            width: "118px",
            height: "4px",
            backgroundColor: "#3593b0",
          },
        }}
      >
        Download the <span color="#3593b0">MyMoneyMantra</span>
        <br />
        Mobile App
      </Typography>
    </Box>
  );
}

export default PlayStore;
